import React from 'react';

export default function Header({ onNewGame }) {
  return (
    <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '12px 16px', background: '#282c34', color: 'white' }}>
      <h1 style={{ margin: 0, fontSize: '1.25rem' }}>Hangman</h1>
      <div>
        <button onClick={onNewGame} style={{ padding: '8px 12px', fontSize: '1rem' }}>New Game</button>
      </div>
    </header>
  );
}
